d9GcSSZMpJwqP9BELsjExEw8rzhWFRTB5O3G5rjeK7VMAV7iV8X9KU8vwf1pttPzFRRqt4wkM";s:8:"filetype";s:3:"jpg";s:5:"width";i:1000;s:6:"height";i:700;s:6:"source";s:67:"https://www.olympicgaragedoor.com/blog/common-garage-door-problems/";s:6:"domain";s:25:"www.olympicgaragedoor.com";}i:20;a:11:{s:7:"keyword";s:36:"garage door flashes but doesn't open";s:4:"slug";s:36:"garage-door-flashes-but-doesn-t-open";s:5:"title";s:109:"Has Your Garage Door Opener Stopped Working In Cold Weather Here S Why Overhead Door Company Of Oklahoma City";s:3:"alt";s:38:"overhead door company of oklahoma city";s:3:"url";s:105:"https://oklahomacityoverheaddoor.com/wp-content/uploads/2019/02/6ebb6df7-40c7-4705-b9be-24e50ccde641.jpeg";s:5:"thumb";s:90:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTAyzRTH6sXwQWdWQblXaGf8n3SQl8PiMmhSg";s:8:"filetype";s:3:"jpg";s:5:"width";i:430;s:6:"height";i:929;s:6:"source";s:112:"https://oklahomacityoverheaddoor.com/blog/has-your-garage-door-opener-stopped-working-in-cold-weather-heres-why/";s:6:"domain";s:28:"oklahomacityoverheaddoor.com";}}s:9:"sentences";a:60:{i:0;s:63:"Garage Door Opener Lights Flash and the Garage Door Wont Close.";i:1;s:148:"When you see your garage door opener lights flashing and the garage door will not close it could be the safety reversing sensors or the LOCK button.";i:2;s:75:"If there is a safety reversing sensor issue the main lights flash 10 times.";i:3;s:39:"Start with aligning the safety sensors.";i:4;s:104:"This will explain how to troubleshoot a garage door opener that wont close the door and blinks 10 times.";i:5;s:125:"This most likely indicates that the garage door sensors are out of alignment or there is something in the way of the sensors.";i:6;s:109:"Garage door openers made after 1993 are equipped with sensors positioned on both sides of the vertical rails.";i:7;s:86:"When your garage door doesnt open with the remote a few things can cause this problem.";i:8;s:26:"You might be out of range.";i:9;s:69:"The antenna on the motor could be damaged or blocked from the signal.";i:10;s:44:"Make sure it is hanging down from the motor.";i:11;s:58:"If the door operates the problem is in the wire or button.";i:12;s:18:"The button is bad.";i:13;s:70:"Disconnect the wires from the button and touch the bare ends together.";i:14;s:94:"If the door operates either the wires werent securely connected to the button or its gone bad.";i:15;s:74:"If the door only moves a few inches and stops the RPM sensor could be bad.";i:16;s:90:"If the motor doesnt run at all you may need to replace the garage door opener logic board.";i:17;s:76:"Although rare a failed drive motor is another reason why the door wont open.";i:18;s:101:"If the motor buzzes and doesnt move an unobstructed and disconnected trolley replace the drive motor.";i:19;s:33:"The battery in the remote is new.";i:20;s:99:"I punch the 4 digit code but instead of opening up the garage door the keypad light blinks rapidly.";i:21;s:132:"Ive tried to reset the keypad using a similar manuals direction push the green SRT button on the base and within 30 seconds enter a.";i:22;s:122:"Four flashes is the most common reason your opener lights may be flashing is because of your sensor eyes being misaligned.";i:23;s:125:"If an object has misaligned your sensor eyes then it breaks the electronic beam preventing the garage door to close properly.";i:24;s:44:"The door will stop and reverse back upwards.";i:25;s:35:"Garage Door Doesnt Open Completely.";i:26;s:88:"If the garage door opens but then stops short there are a few possible reasons for this.";i:27;s:89:"The up-limit switch is a touch-level mounted at the end of the track near the motor unit.";i:28;s:72:"If its too far away you will need to move the switch closer to the unit.";i:29;s:50:"This is a rare problem so you will usually notice.";i:30;s:65:"If your garage door doesnt open or close the track may be broken.";i:31;s:66:"In that case you may need to get your garage door system replaced.";i:32;s:90:"A broken spring repair is one of the most common reasons why a garage door is not opening.";i:33;s:93:"Garage tension springs store mechanical energy that controls the movement of the garage door.";i:34;s:39:"Garage door keypad battery replacement.";i:35;s:84:"Your garage door keypad is indeed battery operated despite being stuck to your wall.";i:36;s:162:"If your keypad stops responding it might be possible that youre not really in need of a garage door keypad repair at all just open it up and swap out the battery.";i:37;s:47:"Most garage door keypads take a 9 volt battery.";i:38;s:69:"To unlock your garage door opener push the lock button for 5 seconds.";i:39;s:79:"Once you push this button the light on the garage door opener will flash twice.";i:40;s:77:"Once you see the double flash press the control button on the remote control.";i:41;s:98:"If this doesnt fix your problem then the problem is more than likely the safety reversing sensors.";i:42;s:164:"The purpose of the safety sensors located on the bottom corners of your garage door is to automatically reverse your door if they detect motion underneath the door.";i:43;s:154:"If the opener cannot detect that the safety sensors are properly working or connected then the opener lights will flash and the door will refuse to close.";i:44;s:59:"Get shopping advice from experts friends and the community.";i:45;s:44:"Craftsman garage door opener model 13953985.";i:46;s:55:"My outside garage door four years old will not operate.";i:47;s:22:"I cannot reprogram it.";i:48;s:175:"When I put the new code in according to directions when I go to open the door it will not open and when you hit the enter buttons the numbers on the outside door opener flash.";i:49;s:34:"Garage door just hums doesnt open.";i:50;s:39:"Jump to Latest Follow 1 - 5 of 5 Posts.";i:51;s:27:"Joined Sep 7 2010 51 Posts.";i:52;s:33:"Discussion Starter 1 Mar 19 2011.";i:53;s:41:"Im trying to troubleshoot my garage door.";i:54;s:197:"The constantly flashing wall button simply means that the door was either put into lock-out mode by someone using the wall panel control or for some reason it defaulted into lock-out mode in error.";i:55;s:147:"When the garage door opener is locked-out the transmitters will be disabled from opening the door but the wall button will still function as usual.";i:56;s:61:"If the opener lights blink check the safety reversing sensor.";i:57;s:84:"If the opener lights do not blink and it is a new installation check the down force.";i:58;s:64:"Repeat the safety reverse test after the adjustment is complete.";i:59;s:70:"The door reverses for no apparent reason and opener lights dont blink.";}}